import React from "react";

const Navbar = () => {
  return (
    <nav>
      <div>
        <div>
          <h2>Plastaps</h2>
        </div>
        <div>
          <button>Buy</button>
          <button>Sell</button>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
